import classes from './banner.module.scss';

function Banner({banner}) {
    console.log(banner)
  return (
    <div className={classes.banner}>
      <div>
        <p className={classes.subfocus}>{banner.subfocus}</p>
        <h2></h2>
      </div>

    </div>
  )
}

export default Banner
